import React, { useState } from 'react';
import { Helmet } from 'react-helmet';
import Navbar8 from '../components/navbar8';
import Footer4 from '../components/footer4';
import './email-input.css';

const EmailInput = () => {
  const [formData, setFormData] = useState({
    senderEmail: '',
    subject: '',
    content: '',
    attachment: null,
  });

  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);
  const [error, setError] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleFileChange = (e) => {
    setFormData((prev) => ({ ...prev, attachment: e.target.files[0] }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setResult(null);

    const formDataToSend = new FormData();
    formDataToSend.append('senderEmail', formData.senderEmail);
    formDataToSend.append('subject', formData.subject);
    formDataToSend.append('content', formData.content);
    if (formData.attachment) {
      formDataToSend.append('attachment', formData.attachment);
    }

    try {
      const response = await fetch('/api/analyze', {
        method: 'POST',
        body: formDataToSend,
      });

      if (!response.ok) {
        throw new Error('Server error: ' + response.statusText);
      }

      const data = await response.json();
      setResult(data); // Save the analysis result
    } catch (err) {
      console.error('Error analyzing email:', err);
      setError(err.message || 'Something went wrong.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="email-input-container">
      <Helmet>
        <title>Email Analysis | Superior Unique Pigeon</title>
      </Helmet>

      <Navbar8 />
      <main className="email-input-main">
        <h1>Email Analysis</h1>
        <p>Submit email details to check for phishing attempts</p>

        <form onSubmit={handleSubmit} className="email-input-form">
          <div className="form-group">
            <label>Sender Email</label>
            <input
              type="email"
              name="senderEmail"
              value={formData.senderEmail}
              onChange={handleChange}
              placeholder="sender@example.com"
              required
            />
          </div>

          <div className="form-group">
            <label>Subject</label>
            <input
              type="text"
              name="subject"
              value={formData.subject}
              onChange={handleChange}
              placeholder="Email subject"
              required
            />
          </div>

          <div className="form-group">
            <label>Email Content</label>
            <textarea
              name="content"
              value={formData.content}
              onChange={handleChange}
              placeholder="Paste the email content here..."
              rows="6"
              required
            />
          </div>

          <div className="form-group">
            <label>Attachment (Optional)</label>
            <input
              type="file"
              onChange={handleFileChange}
              className="file-input"
            />
          </div>

          <button type="submit" className="submit-button" disabled={loading}>
            {loading ? 'Analyzing...' : 'Analyze Email'}
          </button>
        </form>

        {/* Show result */}
        {result && (
          <div className="analysis-result">
            <h2>Analysis Result:</h2>
            <pre>{JSON.stringify(result, null, 2)}</pre>
          </div>
        )}

        {/* Show error */}
        {error && (
          <div className="error-message">
            <p>Error: {error}</p>
          </div>
        )}
      </main>
      <Footer4 />
    </div>
  );
};

export default EmailInput;
